import React  from 'react';
import './App.css';
import Home from './Home';
import Navbar from './Navbar';
import { Router,Route } from 'react-router-dom';


function App() {
  return (

    <Router>
    <div>
      <Navbar /> 
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/news">
        <NewsFeed />
      </Route>
    </div>
  </Router>

  );
}

export default App;
